import mongoose from 'mongoose';
const Schema = mongoose.Schema;

//Create Habit Schema
const HabitSchema = Schema({
  title: {
    type: String,
    required: true
  },
  description: {
    type: String,
  },
  reward: {
    type: String,
    required: true
  },
  complete: {
    type: Boolean,
  },
  link: {
    type: String,
    required: true
  },
  simplify: {
    type: String,
    required: true
  }
})

const Habit = mongoose.model("habit", HabitSchema);
export default Habit;
